import React from "react";

const aboutDesc = () => {
  return (
    <div className="about-desc">
      <h1 className="about__title">about us</h1>
      <h2 className="about__desc-1">
        We are an independent family jeweller with over 40 years' experience and
        expertise in the beautiful world of jewellery. We are passionate about
        offering the highest quality of service and our wealth of knowledge
        guarantees you and your precious jewellery will be exceptionally cared
        for.
      </h2>
      <h2 className="about__desc-2">
        We know this is more than just jewelry. It’s a lifelong symbol of feelings. That’s why we’re more than just a jewelry store. With expert
        jewelers on-site in every location and stores located nationwide - we
        are prepared to help you - when and where you need us.{" "}
      </h2>
    </div>
  );
};

export default aboutDesc;
